    12→/// Run the unified OpenAgents GUI
    13→pub fn run() -> Result<()> {
    14→    tracing::info!("Starting OpenAgents Desktop...");
    15→
    16→    // Initialize GTK (required for Wayland support)
    17→    gtk::init().map_err(|e| anyhow::anyhow!("Failed to initialize GTK: {}", e))?;
    18→
    19→    // Shared shutdown signal
    20→    let shutdown = Arc::new(AtomicBool::new(false));
    21→    let shutdown_clone = shutdown.clone();
    22→
    23→    // Start tokio runtime + actix server in background thread
    24→    let (port_tx, port_rx) = std::sync::mpsc::channel();
    25→
    26→    std::thread::spawn(move || {
    27→        let rt = tokio::runtime::Builder::new_multi_thread()
    28→            .enable_all()
    29→            .build()
    30→            .expect("tokio runtime");
    31→
    32→        rt.block_on(async move {
    33→            let port = start_server().await.expect("start server");
    34→            port_tx.send(port).expect("send port");
    35→
    36→            // Wait for shutdown signal or Ctrl+C
    37→            loop {
    38→                tokio::select! {
    39→                    _ = tokio::signal::ctrl_c() => {
    40→                        tracing::info!("Received Ctrl+C, shutting down...");
    41→                        shutdown_clone.store(true, Ordering::SeqCst);
    42→                        break;
    43→                    }
    44→                    _ = tokio::time::sleep(tokio::time::Duration::from_millis(100)) => {
    45→                        if shutdown_clone.load(Ordering::SeqCst) {
    46→                            break;
    47→                        }
    48→                    }
    49→                }
    50→            }
    51→        });
    52→    });
    53→
    54→    // Wait for server to start
    55→    let port = port_rx.recv().expect("receive port from server thread");
    56→    println!("OPENAGENTS_PORT={}", port);
    57→    tracing::info!("Server running on http://127.0.0.1:{}", port);
    58→
    59→    // Create GTK window (works on both X11 and Wayland)
    60→    let window = gtk::Window::new(gtk::WindowType::Toplevel);
    61→    window.set_title("OpenAgents");
    62→    window.set_default_size(1200, 800);
    63→
    64→    // Create webview using GTK container (Wayland-compatible)
    65→    let url = format!("http://127.0.0.1:{}", port);
    66→    let _webview = wry::WebViewBuilder::new()
    67→        .with_url(&url)
    68→        .build_gtk(&window)
    69→        .map_err(|e| anyhow::anyhow!("Failed to create webview: {}", e))?;
    70→
    71→    window.show_all();
    72→
    73→    // Handle window close
    74→    let shutdown_for_close = shutdown.clone();
    75→    window.connect_delete_event(move |_, _| {
    76→        shutdown_for_close.store(true, Ordering::SeqCst);
    77→        gtk::main_quit();
    78→        glib::Propagation::Stop
    79→    });
    80→
    81→    // Run GTK main loop
    82→    gtk::main();
    83→
    84→    Ok(())
    85→}
